              }}
            >
              Ship Name
            </InputLabel>

            <Autocomplete
            classes={classes}
              multiple
              id="tags-standard"
              options={taskShipNameOption}
              getOptionLabel={(option) => option.name}
              onChange = {shipNameChange}
              renderInput={(params) => (
                <TextField
                  {...params}
                  InputProps={{...params.InputProps, disableUnderline: true}}
                  variant="standard"
                  // label="Multiple values"
                  // placeholder="Favorites"
                />
              )}
            />
            
          </div>
          <div style={{ width: "300px" }}>
            <InputLabel
              style={{
                fontWeight: "bold",
                color: "black",
                fontSize: "16px",
                marginBottom: "10px",
              }}
            >
